import axios from "axios";
import React, { useEffect, useState } from "react";

function B2Bsheet() {
  const [state, setstate] = useState([]);

  useEffect(() => {
    axios
      .get("https://tender-bear-baseball-cap.cyclic.app/Comment")
      .then((data) => setstate(data.data.msg));
  }, []);

  return (
    <div
      style={{
        color: "aqua",
      }}
    >
      {state.length == 0 && <h3>no data avalibale </h3>}

      {state.length > 0 &&
        state.map((v, i) => (
          <div key={i}>
            <h3>{v.CancelationPolicy}</h3>
            <h3>{v.CheckIn}</h3>
            <h3>{v.CheckOut}</h3>
            <h3>{v.HotelName}</h3>
            <h3>{v.Nationality}</h3>
            <h3>{v.Note}</h3>
            <h3>{v.NumberOfPax}</h3>
            <h3>{v.NumberOfUnits}</h3>
            <h3>{v.Price}</h3>
            <h3>{v.RoomType}</h3>
          </div>
        ))}
    </div>
  );
}

export default B2Bsheet;
